import React from 'react';

const EmployeeSelector = ({ employees, onChange, selectedEmployees }) => {
    return (
        <div>
            <label>Employees:</label>
            <select onChange={(e) => onChange(employees.find((emp) => emp.id === e.target.value))}>
                {employees.map((emp) => (
                    <option key={emp.id} value={emp.id}>
                        {emp.name}
                    </option>
                ))}
            </select>
            <ul>
                {selectedEmployees.map((emp) => (
                    <li key={emp.id}>{emp.name}</li>
                ))}
            </ul>
        </div>
    );
};

export default EmployeeSelector;
